import React from "react";
import PlayArrowIcon from '@mui/icons-material/PlayArrow';
import '../assets/styles/Main.scss';

function Main() {
  return (
    <div className="hero-section">
      <div className="hero-white-card">
        <div className="hero-content-wrapper">
          {/* Left Side - Text Content */}
          <div className="hero-text-section">
            <p className="welcome-text">Welcome to Shailee's World:</p>
            <div className="hero-heading-large">
              <div className="heading-line">
                <span className="large-text">WHERE CODE</span>
              </div>
              <div className="heading-line-with-icon">
                <PlayArrowIcon className="play-icon" />
                <div className="sound-wave">
                  <span></span>
                  <span></span>
                  <span></span>
                  <span></span>
                  <span></span>
                </div>
              </div>
              <div className="heading-line">
                <span className="large-text">MEETS INNOVATION</span>
              </div>
            </div>
          </div>

          {/* Center - Hero Image */}
          <div className="hero-image-section">
            <div className="hero-image-container">
              <img 
                src="/favicon.ico" 
                alt="Shailee Patel" 
                className="hero-image"
                onError={(e) => {
                  // Fallback if image doesn't load
                  e.currentTarget.style.display = 'none';
                }}
              />
            </div>
          </div>

          {/* Right Side - CTA and Social */}
          <div className="hero-cta-section">
            <div className="social-links-top">
              <a href="https://github.com/shaileep99" target="_blank" rel="noreferrer" className="social-link">GH</a>
              <a href="https://www.linkedin.com/in/shailee-patel/" target="_blank" rel="noreferrer" className="social-link">LI</a>
            </div>
            <button className="cta-button" onClick={() => {
              const careerSection = document.getElementById('career');
              if (careerSection) {
                careerSection.scrollIntoView({ behavior: 'smooth' });
              }
            }}>
              Explore My World
            </button>
            <p className="hero-description">
              Join me on a journey through the world of software engineering and data systems, 
              where every line of code tells a story, and every project is an innovation.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Main;
